import React, { useState } from 'react';
import api from '../api/api'; 
import { useNavigate, Link } from 'react-router-dom';

function Login({ onLoginSuccess }) {
    const navigate = useNavigate();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');

        try {
            const response = await api.post('/auth/login', { email, password });
            
            const { accessToken, user } = response.data;

            if (!accessToken) {
                setError('No se recibi칩 token v치lido');
                return;
            }

            localStorage.setItem('token', accessToken);
            if (onLoginSuccess) onLoginSuccess(accessToken);

            if (user && user.rol === 'Admin') {
                navigate('/admin');
            } else {
                navigate('/bienvenida');
            }

        } catch (err) {
            console.error(err);
            setError('Email o contrase침a incorrectos');
        }
    };

    // --- ESTILOS MEJORADOS ---

    // ANIMACI칍N DE FONDO CSS
    // Nota: Para un rendimiento 칩ptimo, considera mover esto a un archivo CSS externo.
    const gradientAnimationCss = `
        @keyframes gradientShift {
            0% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
            100% { background-position: 0% 50%; }
        }
    `;

    const PAGE_CONTAINER = { 
        minHeight: '100vh', 
        background: 'linear-gradient(270deg, #1e293b, #334155, #1e293b)', // Gradiente m치s interesante
        backgroundSize: '400% 400%',
        animation: 'gradientShift 20s ease infinite', // Aplicar la animaci칩n
        display: 'flex', 
        flexDirection: 'column', 
        alignItems: 'center', 
        justifyContent: 'center',
        position: 'relative', // Necesario para la animaci칩n
        overflow: 'hidden' // Oculta desbordamientos de la animaci칩n
    };
    
    const navBarButtonStyle = { 
        background: '#7dd3fc', 
        color: '#1e293b', 
        padding: '10px 30px', 
        borderRadius: 8, 
        border: 'none',
        fontWeight: 'bold',
        cursor: 'pointer',
        textDecoration: 'none', // Quitar subrayado del link
        transition: 'background 0.3s ease'
    };
    
    // FORMULARIO M츼S GRANDE
    const formCardStyle = { 
        width: 450, // M치s ancho
        background: 'rgba(51, 65, 85, 0.95)', // Fondo semitransparente para ver el fondo animado
        backdropFilter: 'blur(10px)', // Efecto de desenfoque detr치s del formulario
        borderRadius: 20, // Bordes m치s suaves
        border: '2px solid #475569', 
        padding: 40, // M치s padding
        boxShadow: '0 12px 30px rgba(0,0,0,0.6)', // Sombra m치s prominente
        display: 'flex', 
        flexDirection: 'column', 
        alignItems: 'center',
        zIndex: 1 // Asegura que est칠 por encima del fondo
    };
    
    const welcomeBannerStyle = { 
        background: '#a78Bfa', 
        color: '#1e293b',
        borderRadius: 10, // Bordes m치s suaves
        marginBottom: 25, // M치s espacio
        padding: '12px 0', // M치s padding
        width: '100%', 
        textAlign: 'center', 
        fontWeight: 'bold',
        fontSize: 22 // Texto m치s grande
    };
    
    const inputStyle = { 
        width: '100%', 
        padding: 14, // M치s padding
        marginBottom: 20, // M치s espacio
        borderRadius: 10, // Bordes m치s suaves
        background: '#1e293b', 
        fontSize: 18, // Texto m치s grande
        border: '1px solid #475569',
        color: '#fff', 
        transition: 'border-color 0.3s ease',
        ':focus': {
            borderColor: '#a78Bfa' // Borde lila al enfocar
        }
    };
    
    const submitButtonStyle = { 
        width: '100%', 
        background: '#10b981', 
        color: '#1e293b', 
        padding: 16, // M치s padding
        borderRadius: 10, 
        fontWeight: 'bold', 
        fontSize: 18, 
        border: 'none', 
        marginBottom: 15,
        cursor: 'pointer',
        transition: 'background 0.3s ease, transform 0.2s ease',
        ':hover': {
            background: '#0e9e71', // Verde m치s oscuro al pasar el mouse
            transform: 'translateY(-2px)'
        }
    };
    
    const secondaryButtonStyle = { 
        width: '100%', 
        background: '#475569', 
        color: '#cbd5e1', 
        padding: 12, 
        borderRadius: 10, 
        fontSize: 16, 
        border: 'none',
        cursor: 'pointer',
        transition: 'background 0.3s ease',
        ':hover': {
            background: '#64748b' // Gris m치s claro al pasar el mouse
        }
    };

    return (
        <div style={PAGE_CONTAINER}>
            {/* Insertar la animaci칩n CSS directamente */}
            <style>{gradientAnimationCss}</style>

            {/* Barra superior */}
            <div style={{ width: 500, display: 'flex', justifyContent: 'space-between', marginBottom: 60, zIndex: 1 }}>
                <Link to="/contacto" style={navBarButtonStyle}>Contactanos</Link>
                <button style={{...navBarButtonStyle, background: '#a78Bfa', color: '#1e293b'}}>Login</button>
                <Link to="/" style={navBarButtonStyle}>Inicio</Link>
            </div>
            
            {/* Card central */}
            <div style={formCardStyle}>
                <div style={welcomeBannerStyle}>游녦 Bienvenido de vuelta</div>
                <form style={{ width: '100%' }} onSubmit={handleSubmit}>
                    <label style={{ marginBottom: 5, display: 'block', fontWeight: 'bold', color: '#cbd5e1', fontSize: 16 }}>Email</label>
                    <input type="email" value={email} onChange={e => setEmail(e.target.value)} style={inputStyle} required />
                    
                    <label style={{ marginBottom: 5, display: 'block', fontWeight: 'bold', color: '#cbd5e1', fontSize: 16 }}>Contrase침a</label>
                    <input type="password" value={password} onChange={e => setPassword(e.target.value)} style={inputStyle} required />
                    
                    <button type="submit" style={submitButtonStyle}>Ingresar</button>
                    
                    {error && <div style={{ color: '#ef4444', textAlign: 'center', marginBottom: 12, fontSize: 15 }}>{error}</div>}
                </form>
                <button style={secondaryButtonStyle}>Olvid칠 mi contrase침a</button>
            </div>
        </div>
    );
}

export default Login;
